// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract HouseAuction {
    struct House {
        uint256 id;
        string title;
        string description;
        string imageHash;
        uint256 startPrice;
        address highestBidder;
        uint256 highestBid;
        bool isActive;
        bool isStarted;
        bool isAuctionEnded;
    }

    struct Bid {
        address bidder;
        uint256 amount;
        uint256 timestamp;
    }

    address public admin;
    uint256 public houseCounter;
    mapping(uint256 => House) public houses;
    mapping(uint256 => Bid[]) public bidHistory;

    event HouseAdded(uint256 indexed id, string title);
    event HouseUpdated(uint256 indexed id);
    event HouseDeleted(uint256 indexed id);
    event AuctionStarted(uint256 indexed id);
    event AuctionEnded(uint256 indexed id, address winner, uint256 amount);
    event BidPlaced(uint256 indexed id, address bidder, uint256 amount);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    function addHouse(
        string memory _title,
        string memory _description,
        string memory _imageHash,
        uint256 _startPrice
    ) external onlyAdmin {
        houseCounter++;
        houses[houseCounter] = House({
            id: houseCounter,
            title: _title,
            description: _description,
            imageHash: _imageHash,
            startPrice: _startPrice,
            highestBidder: address(0),
            highestBid: 0,
            isActive: true,
            isStarted: false,
            isAuctionEnded: false
        });
        emit HouseAdded(houseCounter, _title);
    }

    function updateHouse(
        uint256 _id,
        string memory _title,
        string memory _description,
        string memory _imageHash,
        uint256 _startPrice
    ) external onlyAdmin {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House storage house = houses[_id];
        house.title = _title;
        house.description = _description;
        house.imageHash = _imageHash;
        house.startPrice = _startPrice;
        emit HouseUpdated(_id);
    }

    function deleteHouse(uint256 _id) external onlyAdmin {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        delete houses[_id];
        delete bidHistory[_id];
        emit HouseDeleted(_id);
    }

    function startAuction(uint256 _id) external onlyAdmin {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House storage house = houses[_id];
        require(house.isActive, "House is not active");
        require(!house.isStarted, "Auction already started");
        house.isStarted = true;
        emit AuctionStarted(_id);
    }

    function endAuction(uint256 _id) external onlyAdmin {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House storage house = houses[_id];
        require(house.isStarted, "Auction not started");
        require(!house.isAuctionEnded, "Auction already ended");
        house.isAuctionEnded = true;
        emit AuctionEnded(_id, house.highestBidder, house.highestBid);
    }

    function toggleAuctionStatus(uint256 _id) external onlyAdmin {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House storage house = houses[_id];
        house.isActive = !house.isActive;
    }

    function placeBid(uint256 _id) external payable {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House storage house = houses[_id];
        require(house.isActive, "House is not active");
        require(house.isStarted, "Auction not started");
        require(!house.isAuctionEnded, "Auction ended");
        require(msg.value > house.highestBid, "Bid must be higher than current bid");
        require(msg.value >= house.startPrice, "Bid must be at least starting price");

        // Record the bid
        bidHistory[_id].push(Bid({
            bidder: msg.sender,
            amount: msg.value,
            timestamp: block.timestamp
        }));

        // Update highest bid
        house.highestBidder = msg.sender;
        house.highestBid = msg.value;
        
        emit BidPlaced(_id, msg.sender, msg.value);
    }

    function getHouse(uint256 _id) external view returns (
        uint256 id,
        string memory title,
        string memory description,
        string memory imageHash,
        uint256 startPrice,
        address highestBidder,
        uint256 highestBid,
        bool isActive,
        bool isStarted,
        bool isAuctionEnded
    ) {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        House memory house = houses[_id];
        return (
            house.id,
            house.title,
            house.description,
            house.imageHash,
            house.startPrice,
            house.highestBidder,
            house.highestBid,
            house.isActive,
            house.isStarted,
            house.isAuctionEnded
        );
    }

    function getBidCount(uint256 _id) external view returns (uint256) {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        return bidHistory[_id].length;
    }

    function getBidHistory(uint256 _id) external view returns (Bid[] memory) {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        return bidHistory[_id];
    }

    function getBid(uint256 _id, uint256 _index) external view returns (
        address bidder,
        uint256 amount,
        uint256 timestamp
    ) {
        require(_id <= houseCounter && _id > 0, "Invalid house ID");
        require(_index < bidHistory[_id].length, "Invalid bid index");
        Bid memory bid = bidHistory[_id][_index];
        return (bid.bidder, bid.amount, bid.timestamp);
    }
}

